import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
// Importing Sass with Bootstrap CSS
import "./App.scss";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  rootElement
);
